import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';
import { useMapData } from '../hooks/useMapData';
import { createCustomIcon, createBrandLogo } from '../utils/iconHelpers';

// Fix para iconos de Leaflet
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

const MapComponent = ({ selectedRegion, regionCenter }) => {
  const { markers, loading } = useMapData();

 if (loading) {
  return (
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100%',
      fontSize: '16px',
      color: '#666',
      gap: '20px',
      background: 'linear-gradient(135deg, #f5f5f5 0%, #fff 100%)'
    }}>
      <div style={{ fontSize: '40px' }}></div>
      <div>Cargando {markers.length} marcadores...</div>
      <div style={{
        width: '200px',
        height: '4px',
        background: '#e0e0e0',
        borderRadius: '2px',
        overflow: 'hidden'
      }}>
        <div style={{
          height: '100%',
          background: '#00b8a9',
          borderRadius: '2px',
          animation: 'loading 1.5s infinite'
        }}></div>
      </div>
      <style>{`
        @keyframes loading {
          0% { width: 0%; }
          50% { width: 100%; }
          100% { width: 0%; }
        }
      `}</style>
    </div>
  );
}


  // Filtrar marcadores por regi贸n seleccionada
  const filteredMarkers = markers.filter(m => m.Region === selectedRegion);

  const mapCenter = regionCenter || [-33.4474107, -70.5518946];

  return (
    <MapContainer
      center={mapCenter}
      zoom={9}
      style={{ width: '100%', height: '100%' }}
      zoomControl={false}
      key={selectedRegion} // Re-render cuando cambia regi贸n
    >
      <TileLayer
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a>'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
      
      {filteredMarkers.map((marker) => (
        <Marker
          key={marker.id}
          position={[marker.lat, marker.lng]}
          icon={createCustomIcon(marker.Marca)}
        >
          <Popup maxWidth={300} minWidth={250}>
            <div className="popup-container">
              <div className="popup-header">
                <img 
                  src={createBrandLogo(marker.Marca)}
                  alt={marker.Marca}
                  style={{ width: '30px', height: '30px', borderRadius: '50%', objectFit: 'cover' }}
                  onError={(e) => { e.target.style.display = 'none'; }}
                />
                <h3>{marker.nombre}</h3>
              </div>
              <div className="popup-content">
                <div className="popup-data">
                  <strong>Marca:</strong> {marker.Marca}<br />
                  <strong>Region:</strong> {marker.Region}<br />
                  <strong>Comuna:</strong> {marker.Comuna}<br />
                  {marker.direccion && <><strong>Direcci贸n:</strong> {marker.direccion}<br /></>}
                </div>
                <hr style={{ margin: '10px 0', border: 'none', borderTop: '1px solid #e0e0e0' }} />
                <div className="popup-data">
                  <strong>Precios:</strong><br />
                  G93: {marker.precio_g93 ? `$${marker.precio_g93}` : 'N/A'}<br />
                  G95: {marker.precio_g95 ? `$${marker.precio_g95}` : 'N/A'}<br />
                  Diesel: {marker.precio_diesel ? `$${marker.precio_diesel}` : 'N/A'}<br />
                </div>
                {marker.Guerra_Precio === 'Si' && (
                  <>
                    <hr style={{ margin: '10px 0', border: 'none', borderTop: '1px solid #e0e0e0' }} />
                    <div className="popup-data" style={{ color: '#d32f2f', fontWeight: 'bold' }}>
                      锔 Guerra de Precio Activa
                    </div>
                  </>
                )}
              </div>
            </div>
          </Popup>
        </Marker>
      ))}
    </MapContainer>
  );
};

export default MapComponent;
